import axios from 'axios';

export const GET_LABELS = '[MAIL APP] GET LABELS';

export function getLabels()
{
    const request = axios.get('/api/mail-app/labels');

    return (dispatch) =>
        request.then((response) =>
            dispatch({
                type   : GET_LABELS,
                payload: response.data
            })
        );
}
